import React, {Fragment} from 'react'
import SectionTitle from "./includes/SectionTitle";
import Link from "next/link";

const AboutSec = ()=>(
  <Fragment>
    <div className='useEvaluationSec'>
      <div className="container">
        <SectionTitle subject='關於卡利'/>
        <div className="row">
          <div className="card" style="width: 18rem;">
            <img src="images/img-about1.png" className="card-img-top" alt="..." />
              <div className="card-body">
                <h5 className="card-title">Card title</h5>
                <p className="card-text">Some quick example text to build on the card title and make up the bulk of the
                  card's content.</p>
                <Link href="#">
                  <a className="btn btn-primary">Go somewhere</a>
                </Link>
              </div>
          </div>
        </div>
      </div>
    </div>
    <style jsx>{
      `
          .useEvaluationSec::after {
          content: "";
          background: url(images/AboutSecBg.png) no-repeat;
          background-size: cover;
          opacity: 0.32;
          top: 0;
          left: 0;
          bottom: 0;
          right: 0;
          position: absolute;
          z-index: -1;  
          filter: blur(3px); 
          }
          .useEvaluationSec {
          padding: 0 0 25px;  
          position: relative;
          z-index: 0;
          background: rgba(0,0,0,.65);
          }`
    }

    </style>
  </Fragment>
);

export default AboutSec
